import React from 'react';
import { Register } from './pages/registerForm/registerForm';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path = "/register" element = {<Register />}/>
      </Routes>
    </Router>
  );
}
